import axios from 'axios';

const url = "https://specifications.vinaudit.com/v3/selections?format=json&key=9NSOAST0U19Z4HH&id=";

export function getVehicleTrims(id) {
    return dispatch => {
        axios.get(url + `${id}`).then(res => {
            dispatch({
                type: 'GET_VEHICLE_TRIMS',
                trims: res.data.selections
            })
        })
    }
}

export default function reducer(trims = [], action) {
    switch(action.type) {
        case "GET_VEHICLE_TRIMS":
            return action.trims
        default: 
            return trims
    }
}
